window.bookSummaryJSON = "<p>I am both a sinner and a saint, but I bleed vengeance.</p> <p>For years, I’ve lived in the grey… until her.</p> <p>Avery Washington didn’t belong in the shadows, but I dragged her into the darkness anyway.</p> <p>One kiss, and I would stop at nothing to possess her.</p> <p>One caress, and my need to destroy wavered.</p> <p>Our attraction was poison and pleasure.</p> <p>They say the devil recognizes his own, but I never saw Avery coming. She's determined to light the matchsticks, and I can't resist going down in flames...</p> <p>Defied is the final book in the Blood Duet and should not be listened to before Sworn.</p>"; 
